export async function rotateKeys() {
  const redis = getRedis();

  // Generate a new RSA key pair for signing (RS256)
  const { privateKey, publicKey } = await jose.generateKeyPair('RS256', { extractable: true });

  // Generate a unique key ID for the new key
  const kid = crypto.randomUUID();

  // Export the private key in PKCS8 PEM format
  const pem = await jose.exportPKCS8(privateKey);

  // Export the public key as a JWK (JSON Web Key)
  const jwk = await jose.exportJWK(publicKey);

  // Annotate the JWK with metadata
  jwk.kid = kid;
  jwk.alg = 'RS256';
  jwk.use = 'sig';

  // Store the private key PEM and public JWK in Redis, keyed by the new kid
  await redis.set(KEY_PEM_PREFIX + kid, pem);
  await redis.set(KEY_JWK_PREFIX + kid, JSON.stringify(jwk));

  // Set the new key as the active key
  await redis.set(ACTIVE_KID_KEY, kid);

  // Add the new key to the sorted set of recent keys, using the current timestamp as the score
  await redis.zadd(RECENT_KEYS_ZSET, Date.now(), kid);

  // Determine how many keys to keep
  const keep = await getKeepCount();
  // Get the total number of keys currently stored
  const total = await redis.zcard(RECENT_KEYS_ZSET);

  // If there are more keys than the keep count, remove the oldest ones
  if (total > keep) {
    // Get the key IDs to remove (the oldest ones)
    const toRemove = await redis.zrange(RECENT_KEYS_ZSET, 0, total - keep - 1);

    // Delete the private and public keys for each key ID to be removed
    for (const rk of toRemove) {
      await redis.del(KEY_PEM_PREFIX + rk);
      await redis.del(KEY_JWK_PREFIX + rk);
    }

    // Remove the key IDs from the sorted set
    await redis.zrem(RECENT_KEYS_ZSET, ...toRemove);
  }

  // Return the new key ID and private key
  return { kid, privateKey };
}
